        function getCoordenadasByUfCidade(uf, cidade) {
            uf = uf.toUpperCase();
            cidade = retira_acentos(trim(cidade.toLowerCase()));
            /*
            var resultado = $filter('filter')(coordenadas[uf], { cidade: cidade }, false);
            if (resultado) if (resultado.length == 1) {
            return resultado[0];
            }
            */

            for (var aux in coordenadas[uf]) {
                if (retira_acentos(trim(coordenadas[uf][aux].cidade.toLowerCase())) == cidade) {
                    return coordenadas[uf][aux];
                }
            }
            return null;
        }

        function getCoordenadasByUf(uf) {
            uf = uf.toUpperCase();

            for (var iUF = 0; iUF < coordenadasUF.length; iUF++) {
                if (coordenadasUF[iUF].sigla == uf) {
                    return coordenadasUF[iUF];
                }
            }

            return null;
        }

        function retira_acentos(palavra) {
            var com_acento = 'áàãâäéèêëíìîïóòõôöúùûüçÁÀÃÂÄÉÈÊËÍÌÎÏÓÒÕÖÔÚÙÛÜÇ';
            var sem_acento = 'aaaaaeeeeiiiiooooouuuucAAAAAEEEEIIIIOOOOOUUUUC';
            var nova = '';
            for (i = 0; i < palavra.length; i++) {
                if (com_acento.search(palavra.substr(i, 1)) >= 0) {
                    nova += sem_acento.substr(com_acento.search(palavra.substr(i, 1)), 1);
                } else {
                    nova += palavra.substr(i, 1);
                }
            }
            return nova.toLowerCase();
        }

        function removeEspacoTraco(palavra) {
            var nova = "";

            nova = trim(palavra);
            nova = nova.replace("-", "");
            nova = nova.replace(/\s/g, '');

            return nova.toLowerCase();
        }

        function trim(str) {
            return str.replace(/^\s+|\s+$/g, "");
        }

